func nearestExit(maze [][]byte, entrance []int) int {
	record := list.New()
	record.Init()
	entrance = append(entrance, 0)
	record.PushBack(entrance)
	rowlen := len(maze)
	columnlen := len(maze[0])
	//minimum := rowlen * columnlen
	//ansbool := false
	visit := [][]int{}
	dir := [][]int{{-1, 0}, {0, 1}, {1, 0}, {0, -1}}
	for i := 0; i < rowlen; i++ {
		visitrow := make([]int, columnlen)
		visit = append(visit, visitrow)
	}

	for record.Len() > 0 {
		current := record.Front().Value.([]int)
		for i := 0; i < len(dir); i++ {
			newrow := current[0] + dir[i][0]
			newcolumn := current[1] + dir[i][1]
			if newrow >= 0 && newcolumn >= 0 && newrow < rowlen && newcolumn < columnlen && maze[newrow][newcolumn] == '.' && visit[newrow][newcolumn] == 0 {
				if newrow == 0 || newcolumn == 0 || newrow == rowlen-1 || newcolumn == columnlen-1 {
					return current[2] + 1
				}
				visit[newrow][newcolumn] = 1
				record.PushBack([]int{newrow, newcolumn, current[2] + 1})
			}
		}
		visit[current[0]][current[1]] = 1
		record.Remove(record.Front())
	}

	return -1

}

